I.1 08.01.05: "\u041D\u0435\u0439\u0440\u043E\u0445\u0456\u0440\u0443\u0440\u0433\u0456\u044F"
I.1 08.01.06: "\u0423\u0440\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.01.07: "\u041E\u043D\u043A\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.01.08: "\u0422\u0440\u0430\u043D\u0441\u043F\u043B\u0430\u043D\u0442\u043E\u043B\u043E\u0433\u0456\u044F \u0442\u0430 \u0448\u0442\u0443\u0447\u043D\u0456 \u043E\u0440\u0433\u0430\u043D\u0438"
I.1 08.01.09: "\u0414\u0438\u0442\u044F\u0447\u0430 \u0445\u0456\u0440\u0443\u0440\u0433\u0456\u044F"
I.1 08.01.10: "\u041F\u0435\u0434\u0456\u0430\u0442\u0440\u0456\u044F"
I.1 08.01.11: "\u041A\u0430\u0440\u0434\u0456\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.01.12: "\u0420\u0435\u0432\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.01.13: "\u0406\u043D\u0444\u0435\u043A\u0446\u0456\u0439\u043D\u0456 \u0445\u0432\u043E\u0440\u043E\u0431\u0438"
I.1 08.01.14: "\u0415\u043D\u0434\u043E\u043A\u0440\u0438\u043D\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.01.15: "\u041D\u0435\u0440\u0432\u043E\u0432\u0456 \u0445\u0432\u043E\u0440\u043E\u0431\u0438"
I.1 08.01.16: "\u041F\u0441\u0438\u0445\u0456\u0430\u0442\u0440\u0456\u044F"
I.1 08.01.17: "\u041D\u0430\u0440\u043A\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.01.18: "\u041E\u0447\u043D\u0456 \u0445\u0432\u043E\u0440\u043E\u0431\u0438"
I.1 08.01.19: "\u041E\u0442\u043E\u0440\u0438\u043D\u043E\u043B\u0430\u0440\u0438\u043D\u0433\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.01.20: "\u0428\u043A\u0456\u0440\u043D\u0456 \u0442\u0430 \u0432\u0435\u043D\u0435\u0440\u0438\u0447\u043D\u0456 \u0445\u0432\u043E\u0440\u043E\u0431\u0438"
I.1 08.01.21: "\u0422\u0440\u0430\u0432\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0456\u044F \u0442\u0430 \u043E\u0440\u0442\u043E\u043F\u0435\u0434\u0456\u044F"
I.1 08.01.22: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.01.23: "\u041F\u0440\u043E\u043C\u0435\u043D\u0435\u0432\u0430 \u0434\u0456\u0430\u0433\u043D\u043E\u0441\u0442\u0438\u043A\u0430 \u0442\u0430 \u043F\u0440\u043E\u043C\u0435\u043D\u0435\u0432\u0430 \u0442\u0435\u0440\u0430\u043F\u0456\u044F"
I.1 08.01.24: "\u041B\u0456\u043A\u0443\u0432\u0430\u043B\u044C\u043D\u0430 \u0444\u0456\u0437\u043A\u0443\u043B\u044C\u0442\u0443\u0440\u0430"
I.1 08.01.25: "\u0421\u0443\u0434\u043E\u0432\u0430 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0430"
I.1 08.01.26: "\u0424\u0442\u0438\u0437\u0456\u0430\u0442\u0440\u0456\u044F"
I.1 08.01.27: "\u041F\u0443\u043B\u044C\u043C\u043E\u043D\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.01.28: "\u041A\u043B\u0456\u043D\u0456\u0447\u043D\u0430 \u0444\u0430\u0440\u043C\u0430\u043A\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.01.29: "\u041A\u043B\u0456\u043D\u0456\u0447\u043D\u0430 \u0456\u043C\u0443\u043D\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.01.30: "\u0410\u043D\u0435\u0441\u0442\u0435\u0437\u0456\u043E\u043B\u043E\u0433\u0456\u044F \u0442\u0430 \u0456\u043D\u0442\u0435\u043D\u0441\u0438\u0432\u043D\u0430 \u0442\u0435\u0440\u0430\u043F\u0456\u044F"
I.1 08.01.31: "\u0413\u0435\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0456\u044F \u0456 \u0442\u0440\u0430\u043D\u0441\u0444\u0443\u0437\u0456\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.01.32: "\u041C\u0435\u0434\u0438\u0447\u043D\u0430 \u0431\u0456\u043E\u0445\u0456\u043C\u0456\u044F"
I.1 08.01.33: "\u041A\u0443\u0440\u043E\u0440\u0442\u043E\u043B\u043E\u0433\u0456\u044F \u0442\u0430 \u0444\u0456\u0437\u0456\u043E\u0442\u0435\u0440\u0430\u043F\u0456\u044F"
I.1 08.02: "\u041F\u0440\u043E\u0444\u0456\u043B\u0430\u043A\u0442\u0438\u0447\u043D\u0430 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0430"
I.1 08.02.01: "\u0413\u0456\u0433\u0456\u0454\u043D\u0430"
I.1 08.02.02: "\u0415\u043F\u0456\u0434\u0435\u043C\u0456\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.02.03: "\u0421\u043E\u0446\u0456\u0430\u043B\u044C\u043D\u0430 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0430 \u0442\u0430 \u043E\u0445\u043E\u0440\u043E\u043D\u0430 \u0437\u0434\u043E\u0440\u043E\u0432'\u044F"
I.1 08.03: "\u0422\u0435\u043E\u0440\u0435\u0442\u0438\u0447\u043D\u0430 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0430"
I.1 08.03.01: "\u041D\u043E\u0440\u043C\u0430\u043B\u044C\u043D\u0430 \u0430\u043D\u0430\u0442\u043E\u043C\u0456\u044F"
I.1 08.03.02: "\u041F\u0430\u0442\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0430 \u0430\u043D\u0430\u0442\u043E\u043C\u0456\u044F"
I.1 08.03.03: "\u041D\u043E\u0440\u043C\u0430\u043B\u044C\u043D\u0430 \u0444\u0456\u0437\u0456\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.03.04: "\u041F\u0430\u0442\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0430 \u0444\u0456\u0437\u0456\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.03.05: "\u0424\u0430\u0440\u043C\u0430\u043A\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.03.06: "\u0422\u043E\u043A\u0441\u0438\u043A\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.03.07: "\u0424\u0456\u0437\u0456\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u043E \u0430\u043A\u0442\u0438\u0432\u043D\u0456 \u0441\u043F\u043E\u043B\u0443\u043A\u0438"
I.1 08.03.08: "\u0406\u043C\u0443\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0442\u0430 \u0430\u043B\u0435\u0440\u0433\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 08.03.09: "\u0413\u0456\u0441\u0442\u043E\u043B\u043E\u0433\u0456\u044F, \u0446\u0438\u0442\u043E\u043B\u043E\u0433\u0456\u044F, \u0435\u043C\u0431\u0440\u0456\u043E\u043B\u043E\u0433\u0456\u044F"
I.1 09: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0444\u0430\u0440\u043C\u0430\u0446\u0435\u0432\u0442\u0438\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.1 09.00: "\u0424\u0430\u0440\u043C\u0430\u0446\u0435\u0432\u0442\u0438\u0447\u043D\u0456 \u043D\u0430\u0443\u043A\u0438"
I.1 09.00.01: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043B\u0456\u043A\u0456\u0432 \u0442\u0430 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0430 \u0444\u0430\u0440\u043C\u0430\u0446\u0456\u044F"
I.1 09.00.02: "\u0424\u0430\u0440\u043C\u0430\u0446\u0435\u0432\u0442\u0438\u0447\u043D\u0430 \u0445\u0456\u043C\u0456\u044F \u0442\u0430 \u0444\u0430\u0440\u043C\u0430\u043A\u043E\u0433\u043D\u043E\u0437\u0456\u044F"
I.10: "\u0414\u041E\u0421\u041B\u0406\u0414\u0416\u0415\u041D\u041D\u042F \u0422\u0410 \u0420\u041E\u0417\u0420\u041E\u0411\u041A\u0418 \u0412 \u0413\u0410\u041B\u0423\u0417\u0406 \u041F\u0420\u0418\u0420\u041E\u0414\u041D\u0418\u0427\u0418\u0425 \u041D\u0410\u0423\u041A"
I.10.10: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0444\u0456\u0437\u0438\u043A\u043E-\u043C\u0430\u0442\u0435\u043C\u0430\u0442\u0438\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.10.20: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0445\u0456\u043C\u0456\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.10.30: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0431\u0456\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.10.40: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0433\u0435\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.10.50: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0433\u0435\u043E\u0433\u0440\u0430\u0444\u0456\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.10.60: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u0438\u0445 \u043D\u0430\u0443\u043A"
I.10.70: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0432\u0435\u0442\u0435\u0440\u0438\u043D\u0430\u0440\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.10.80: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u043C\u0435\u0434\u0438\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.10.90: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0444\u0430\u0440\u043C\u0430\u0446\u0435\u0432\u0442\u0438\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.2: "\u0414\u041E\u0421\u041B\u0406\u0414\u0416\u0415\u041D\u041D\u042F \u0422\u0410 \u0420\u041E\u0417\u0420\u041E\u0411\u041A\u0418 \u0412 \u0413\u0410\u041B\u0423\u0417\u0406 \u0422\u0415\u0425\u041D\u0406\u0427\u041D\u0418\u0425 \u041D\u0410\u0423\u041A"
I.2 10: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0437\u0430\u0433\u0430\u043B\u044C\u043D\u043E\u0442\u0435\u0445\u043D\u0456\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.2 10.01.01: "\u041F\u0440\u0438\u043A\u043B\u0430\u0434\u043D\u0430 \u0433\u0435\u043E\u043C\u0435\u0442\u0440\u0456\u044F, \u0456\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u0430 \u0433\u0440\u0430\u0444\u0456\u043A\u0430"
I.2 10.01.02: "\u0421\u0442\u0430\u043D\u0434\u0430\u0440\u0442\u0438\u0437\u0430\u0446\u0456\u044F \u0442\u0430 \u0441\u0435\u0440\u0442\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u044F"
I.2 10.01.03: "\u0422\u0435\u0445\u043D\u0456\u0447\u043D\u0430 \u0435\u0441\u0442\u0435\u0442\u0438\u043A\u0430"
I.2 10.01.04: "\u0415\u0440\u0433\u043E\u043D\u043E\u043C\u0456\u043A\u0430"
I.2 10.26: "\u0411\u0435\u0437\u043F\u0435\u043A\u0430 \u0436\u0438\u0442\u0442\u0454\u0434\u0456\u044F\u043B\u044C\u043D\u043E\u0441\u0442\u0456"
I.2 10.26.01: "\u041E\u0445\u043E\u0440\u043E\u043D\u0430 \u043F\u0440\u0430\u0446\u0456"
I.2 10.26.03: "\u041F\u043E\u0436\u0435\u0436\u043D\u0430 \u0431\u0435\u0437\u043F\u0435\u043A\u0430"
I.2 11: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u043C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u0457, \u043E\u0431\u0440\u043E\u0431\u043A\u0438 \u043C\u0435\u0442\u0430\u043B\u0456\u0432, \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430 \u043C\u0430\u0448\u0438\u043D \u0442\u0430 \u0443\u0441\u0442\u0430\u0442\u043A\u0443\u0432\u0430\u043D\u043D\u044F"
I.2 11.02: "\u041C\u0430\u0448\u0438\u043D\u043E\u0437\u043D\u0430\u0432\u0441\u0442\u0432\u043E"
I.2 11.02.01: "\u041C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u043E\u0437\u043D\u0430\u0432\u0441\u0442\u0432\u043E"
I.2 11.02.02: "\u0422\u0435\u043E\u0440\u0456\u044F \u043C\u0430\u0448\u0438\u043D"
I.2 11.02.03: "\u0421\u0438\u0441\u0442\u0435\u043C\u0438 \u043F\u0440\u0438\u0432\u043E\u0434\u0456\u0432"
I.2 11.02.04: "\u0422\u0435\u0440\u0442\u044F \u0442\u0430 \u0437\u043D\u043E\u0448\u0443\u0432\u0430\u043D\u043D\u044F \u0432 \u043C\u0430\u0448\u0438\u043D\u0430\u0445"
I.2 11.02.08: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043C\u0430\u0448\u0438\u043D\u043E\u0431\u0443\u0434\u0443\u0432\u0430\u043D\u043D\u044F"
I.2 11.02.09: "\u0414\u0438\u043D\u0430\u043C\u0456\u043A\u0430, \u043C\u0456\u0446\u043D\u0456\u0441\u0442\u044C \u043C\u0430\u0448\u0438\u043D, \u043F\u0440\u0438\u043B\u0430\u0434\u0456\u0432 \u0442\u0430 \u0430\u043F\u0430\u0440\u0430\u0442\u0443\u0440\u0438"
I.2 11.02.10: "\u041D\u0430\u0434\u0456\u0439\u043D\u0456\u0441\u0442\u044C \u043C\u0430\u0448\u0438\u043D"
I.2 11.03: "\u041E\u0431\u0440\u043E\u0431\u043A\u0430 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432 \u0443 \u043C\u0430\u0448\u0438\u043D\u043E\u0431\u0443\u0434\u0443\u0432\u0430\u043D\u043D\u0456"
I.2 11.03.01: "\u041F\u0440\u043E\u0446\u0435\u0441\u0438 \u043C\u0435\u0445\u0430\u043D\u0456\u0447\u043D\u043E\u0457 \u043E\u0431\u0440\u043E\u0431\u043A\u0438, \u0432\u0435\u0440\u0441\u0442\u0430\u0442\u0438 \u0442\u0430 \u0456\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u0438"
I.2 11.03.05: "\u041F\u0440\u043E\u0446\u0435\u0441\u0438 \u0442\u0430 \u043C\u0430\u0448\u0438\u043D\u0438 \u043E\u0431\u0440\u043E\u0431\u043A\u0438 \u0442\u0438\u0441\u043A\u043E\u043C"
I.2 11.03.06: "\u0417\u0432\u0430\u0440\u044E\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u0441\u043F\u043E\u0440\u0456\u0434\u043D\u0435\u043D\u0456 \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u0457"
I.2 11.03.07: "\u041F\u0440\u043E\u0446\u0435\u0441\u0438 \u0444\u0456\u0437\u0438\u043A\u043E-\u0442\u0435\u0445\u043D\u0456\u0447\u043D\u043E\u0433\u043E \u043E\u0431\u0440\u043E\u0431\u043B\u0435\u043D\u043D\u044F"
I.2 11.04: "\u0415\u043D\u0435\u0440\u0433\u0435\u0442\u0438\u0447\u043D\u0435 \u043C\u0430\u0448\u0438\u043D\u043E\u0431\u0443\u0434\u0443\u0432\u0430\u043D\u043D\u044F"
I.2 11.04.01: "\u041A\u043E\u0442\u043B\u0438, \u043F\u0430\u0440\u043E\u0433\u0435\u043D\u0435\u0440\u0430\u0442\u043E\u0440\u0438 \u0442\u0430 \u043A\u0430\u043C\u0435\u0440\u0438 \u0437\u0433\u043E\u0440\u044F\u043D\u043D\u044F"
I.2 11.04.02: "\u0422\u0435\u043F\u043B\u043E\u0432\u0456 \u0434\u0432\u0438\u0433\u0443\u043D\u0438"
I.2 11.04.03: "\u0425\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u0430 \u0442\u0430 \u043A\u0440\u0456\u043E\u0433\u0435\u043D\u043D\u0430 \u0442\u0435\u0445\u043D\u0456\u043A\u0430, \u0441\u0438\u0441\u0442\u0435\u043C\u0438 \u043A\u043E\u043D\u0434\u0438\u0446\u0456\u043E\u043D\u0443\u0432\u0430\u043D\u043D\u044F"
I.2 11.04.06: "\u0412\u0430\u043A\u0443\u0443\u043C\u043D\u0430 \u0442\u0430 \u043A\u043E\u043C\u043F\u0440\u0435\u0441\u043E\u0440\u043D\u0430 \u0442\u0435\u0445\u043D\u0456\u043A\u0430"
I.2 11.04.11: "\u0410\u0442\u043E\u043C\u043D\u0435 \u0440\u0435\u0430\u043A\u0442\u043E\u0440\u043E\u0431\u0443\u0434\u0443\u0432\u0430\u043D\u043D\u044F"
I.2 11.04.12: "\u0422\u0443\u0440\u0431\u043E\u043C\u0430\u0448\u0438\u043D\u0438 \u0442\u0430 \u0442\u0443\u0440\u0431\u043E\u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438"
I.2 11.04.13: "\u0413\u0456\u0434\u0440\u0430\u0432\u043B\u0456\u0447\u043D\u0456 \u043C\u0430\u0448\u0438\u043D\u0438 \u0442\u0430 \u0433\u0456\u0434\u0440\u043E\u043F\u043D\u0435\u0432\u043C\u043E\u0430\u0433\u0440\u0435\u0433\u0430\u0442\u0438"
I.2 11.04.15: "\u0421\u0443\u0434\u043D\u043E\u0432\u0456 \u0435\u043D\u0435\u0440\u0433\u0435\u0442\u0438\u0447\u043D\u0456 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438"
I.2 11.05: "\u0424\u0443\u043D\u043A\u0446\u0456\u043E\u043D\u0430\u043B\u044C\u043D\u0435 (\u0433\u0430\u043B\u0443\u0437\u0435\u0432\u0435) \u043C\u0430\u0448\u0438\u043D\u043E\u0431\u0443\u0434\u0443\u0432\u0430\u043D\u043D\u044F"
I.2 11.05.01: "\u041C\u0430\u0448\u0438\u043D\u0438 \u0456 \u043F\u0440\u043E\u0446\u0435\u0441\u0438 \u043F\u043E\u043B\u0456\u0433\u0440\u0430\u0444\u0456\u0447\u043D\u043E\u0433\u043E \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430"
I.2 11.05.02: "\u041C\u0430\u0448\u0438\u043D\u0438 \u0434\u043B\u044F \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430 \u0431\u0443\u0434\u0456\u0432\u0435\u043B\u044C\u043D\u0438\u0445 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432 \u0456 \u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0456\u0439"
I.2 11.05.04: "\u041C\u0430\u0448\u0438\u043D\u0438 \u0434\u043B\u044F \u0437\u0435\u043C\u043B\u044F\u043D\u0438\u0445 \u0442\u0430 \u0434\u043E\u0440\u043E\u0436\u043D\u0456\u0445 \u0440\u043E\u0431\u0456\u0442"
I.2 11.05.05: "\u041F\u0456\u0434\u0456\u0439\u043C\u0430\u043B\u044C\u043D\u043E-\u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u0456 \u043C\u0430\u0448\u0438\u043D\u0438"
I.2 11.05.06: "\u0413\u0456\u0440\u043D\u0438\u0447\u0456 \u043C\u0430\u0448\u0438\u043D\u0438"
I.2 11.05.07: "\u041C\u0430\u0448\u0438\u043D\u0438 \u0434\u043B\u044F \u043B\u0456\u0441\u043E\u0432\u043E\u0433\u043E \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u0443"
I.2 11.05.08: "\u041C\u0430\u0448\u0438\u043D\u0438 \u043C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u0439\u043D\u043E\u0433\u043E \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430"
I.2 11.05.09: "\u041C\u0430\u0448\u0438\u043D\u0438 \u0445\u0430\u0440\u0447\u043E\u0432\u043E\u0457, \u043C\u0456\u043A\u0440\u043E\u0431\u0456\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u043E\u0457 \u0442\u0430 \u0444\u0430\u0440\u043C\u0430\u0446\u0435\u0432\u0442\u0438\u0447\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
I.2 11.05.10: "\u041C\u0430\u0448\u0438\u043D\u0438 \u043B\u0435\u0433\u043A\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
I.2 11.05.11: "\u0421\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u0456 \u043C\u0430\u0448\u0438\u043D\u0438"
I.2 11.05.12: "\u041C\u0430\u0448\u0438\u043D\u0438 \u043D\u0430\u0444\u0442\u043E\u0432\u043E\u0457 \u0442\u0430 \u0433\u0430\u0437\u043E\u0432\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
I.2 11.05.13: "\u041C\u0430\u0448\u0438\u043D\u0438 \u0442\u0430 \u0430\u043F\u0430\u0440\u0430\u0442\u0438 \u0445\u0456\u043C\u0456\u0447\u043D\u0438\u0445 \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432"
I.2 11.07: "\u0410\u0432\u0456\u0430\u0446\u0456\u0439\u043D\u0430 \u0442\u0430 \u0440\u0430\u043A\u0435\u0442\u043D\u043E-\u043A\u043E\u0441\u043C\u0456\u0447\u043D\u0430 \u0442\u0435\u0445\u043D\u0456\u043A\u0430"
I.2 11.07.01: "\u0410\u0435\u0440\u043E\u0434\u0438\u043D\u0430\u043C\u0456\u043A\u0430, \u0433\u0430\u0437\u043E\u0434\u0438\u043D\u0430\u043C\u0456\u043A\u0430 \u0442\u0430 \u043F\u0440\u043E\u0446\u0435\u0441\u0438 \u0442\u0435\u043F\u043B\u043E\u043E\u0431\u043C\u0456\u043D\u0443 \u043B\u0456\u0442\u0430\u043B\u044C\u043D\u0438\u0445 \u0430\u043F\u0430\u0440\u0430\u0442\u0456\u0432"
I.2 11.07.02: "\u041F\u0440\u043E\u0435\u043A\u0442\u0443\u0432\u0430\u043D\u043D\u044F \u043B\u0456\u0442\u0430\u043B\u044C\u043D\u0438\u0445 \u0430\u043F\u0430\u0440\u0430\u0442\u0456\u0432"
I.2 11.07.03: "\u041C\u0456\u0446\u043D\u0456\u0441\u0442\u044C \u043B\u0456\u0442\u0430\u043B\u044C\u043D\u0438\u0445 \u0430\u043F\u0430\u0440\u0430\u0442\u0456\u0432"
I.2 11.07.04: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430 \u043B\u0456\u0442\u0430\u043B\u044C\u043D\u0438\u0445 \u0430\u043F\u0430\u0440\u0430\u0442\u0456\u0432"
I.2 11.07.05: "\u0422\u0435\u043F\u043B\u043E\u0432\u0456 \u0434\u0432\u0438\u0433\u0443\u043D\u0438 \u043B\u0456\u0442\u0430\u043B\u044C\u043D\u0438\u0445 \u0430\u043F\u0430\u0440\u0430\u0442\u0456\u0432"
I.2 11.07.06: "\u041D\u0430\u0437\u0435\u043C\u043D\u0456 \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u0438, \u0441\u0442\u0430\u0440\u0442\u043E\u0432\u0435 \u043E\u0431\u043B\u0430\u0434\u043D\u0430\u043D\u043D\u044F"
I.2 11.07.07: "\u0412\u0438\u043F\u0440\u043E\u0431\u0443\u0432\u0430\u043D\u043D\u044F \u043B\u0456\u0442\u0430\u043B\u044C\u043D\u0438\u0445 \u0430\u043F\u0430\u0440\u0430\u0442\u0456\u0432 \u0442\u0430 \u0457\u0445 \u0441\u0438\u0441\u0442\u0435\u043C"
I.2 11.07.09: "\u0414\u0438\u043D\u0430\u043C\u0456\u043A\u0430, \u0431\u0430\u043B\u0456\u0441\u0442\u0438\u043A\u0430 \u0442\u0430 \u043A\u0435\u0440\u0443\u0432\u0430\u043D\u043D\u044F \u0440\u0443\u0445\u043E\u043C \u043B\u0456\u0442\u0430\u043B\u044C\u043D\u0438\u0445 \u0430\u043F\u0430\u0440\u0430\u0442\u0456\u0432"
I.2 11.07.10: "\u0415\u043B\u0435\u043A\u0442\u0440\u043E\u0440\u0430\u043A\u0435\u0442\u043D\u0456 \u0434\u0432\u0438\u0433\u0443\u043D\u0438 \u0442\u0430 \u0435\u043D\u0435\u0440\u0433\u043E\u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438"
I.2 11.07.11: "\u0422\u0435\u043F\u043B\u043E\u0432\u0456 \u0440\u0435\u0436\u0438\u043C\u0438 \u043B\u0456\u0442\u0430\u043B\u044C\u043D\u0438\u0445 \u0430\u043F\u0430\u0440\u0430\u0442\u0456\u0432"
I.2 11.07.12: "\u0414\u0438\u0441\u0442\u0430\u043D\u0446\u0456\u0439\u043D\u0456 \u0430\u0435\u0440\u043E\u043A\u043E\u0441\u043C\u0456\u0447\u043D\u0456 \u0434\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F"
I.2 11.07.14: "\u0410\u0432\u0456\u0430\u0446\u0456\u0439\u043D\u043E-\u043A\u043E\u0441\u043C\u0456\u0447\u043D\u0456 \u0442\u0440\u0435\u043D\u0430\u0436\u0435\u0440\u0438 \u0442\u0430 \u043F\u0456\u043B\u043E\u0442\u0430\u0436\u043D\u0456 \u0441\u0442\u0435\u043D\u0434\u0438"
I.2 11.07.15: "\u0412\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u043E \u0442\u0430 \u0443\u0442\u0438\u043B\u0456\u0437\u0430\u0446\u0456\u044F \u043F\u0430\u043B\u0438\u0432 \u043B\u0456\u0442\u0430\u043B\u044C\u043D\u0438\u0445 \u0430\u043F\u0430\u0440\u0430\u0442\u0456\u0432"
I.2 11.08: "\u0421\u0443\u0434\u043D\u043E\u0431\u0443\u0434\u0443\u0432\u0430\u043D\u043D\u044F"
I.2 11.08.01: "\u0422\u0435\u043E\u0440\u0456\u044F \u0441\u0443\u0434\u0435\u043D"
I.2 11.08.03: "\u041C\u0435\u0445\u0430\u043D\u0456\u043A\u0430 \u0442\u0430 \u043A\u043E\u043D\u0441\u0442\u0440\u0443\u044E\u0432\u0430\u043D\u043D\u044F \u0441\u0443\u0434\u0435\u043D"
I.2 11.08.04: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0441\u0443\u0434\u043D\u043E\u0431\u0443\u0434\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u0441\u0443\u0434\u043D\u043E\u0440\u0435\u043C\u043E\u043D\u0442\u0443"
I.2 11.09: "\u0415\u043B\u0435\u043A\u0442\u0440\u043E\u0442\u0435\u0445\u043D\u0456\u043A\u0430"
I.2 11.09.01: "\u0415\u043B\u0435\u043A\u0442\u0440\u0438\u0447\u043D\u0456 \u043C\u0430\u0448\u0438\u043D\u0438 \u0442\u0430 \u0430\u043F\u0430\u0440\u0430\u0442\u0438"
I.2 11.09.03: "\u0415\u043B\u0435\u043A\u0442\u0440\u043E\u0442\u0435\u0445\u043D\u0456\u0447\u043D\u0456 \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u0438 \u0442\u0430 \u0441\u0438\u0441\u0442\u0435\u043C\u0438"
I.2 11.09.05: "\u0422\u0435\u043E\u0440\u0435\u0442\u0438\u0447\u043D\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0442\u0435\u0445\u043D\u0456\u043A\u0430"
I.2 11.09.07: "\u0421\u0432\u0456\u0442\u043B\u043E\u0442\u0435\u0445\u043D\u0456\u043A\u0430 \u0442\u0430 \u0434\u0436\u0435\u0440\u0435\u043B\u0430 \u0441\u0432\u0456\u0442\u043B\u0430"
I.2 11.09.08: "\u0415\u043B\u0435\u043A\u0442\u0440\u043E\u0430\u043A\u0443\u0441\u0442\u0438\u043A\u0430 \u0442\u0430 \u0437\u0432\u0443\u043A\u043E\u0442\u0435\u0445\u043D\u0456\u043A\u0430"
I.2 11.09.10: "\u0415\u043B\u0435\u043A\u0442\u0440\u043E\u0442\u0435\u0440\u043C\u0456\u0447\u043D\u0456 \u043F\u0440\u043E\u0446\u0435\u0441\u0438 \u0442\u0430 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438"
I.2 11.09.12: "\u041D\u0430\u043F\u0456\u0432\u043F\u0440\u043E\u0432\u0456\u0434\u043D\u0438\u043A\u043E\u0432\u0456 \u043F\u0435\u0440\u0435\u0442\u0432\u043E\u0440\u044E\u0432\u0430\u0447\u0456 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0435\u043D\u0435\u0440\u0433\u0456\u0457"
I.2 11.09.13: "\u0422\u0435\u0445\u043D\u0456\u043A\u0430 \u0441\u0438\u043B\u044C\u043D\u0438\u0445 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0447\u043D\u0438\u0445 \u0442\u0430 \u043C\u0430\u0433\u043D\u0456\u0442\u043D\u0438\u0445 \u043F\u043E\u043B\u0456\u0432"
I.2 11.09.15: "\u041D\u0430\u0434\u043F\u0440\u043E\u0432\u0456\u0434\u043D\u0456 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0442\u0435\u0445\u043D\u0456\u0447\u043D\u0456 \u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457"
I.2 11.16: "\u041C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u044F"
I.2 11.16.01: "\u041C\u0435\u0442\u0430\u043B\u043E\u0437\u043D\u0430\u0432\u0441\u0442\u0432\u043E \u0456 \u0442\u0435\u0440\u043C\u0456\u0447\u043D\u0435 \u043E\u0431\u0440\u043E\u0431\u043B\u0435\u043D\u043D\u044F \u043C\u0435\u0442\u0430\u043B\u0456\u0432"
I.2 11.16.02: "\u041C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u044F \u0447\u043E\u0440\u043D\u0438\u0445 \u043C\u0435\u0442\u0430\u043B\u0456\u0432"
I.2 11.16.03: "\u041C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u044F \u043A\u043E\u043B\u044C\u043E\u0440\u043E\u0432\u0438\u0445 \u0442\u0430 \u0440\u0456\u0434\u043A\u0456\u0441\u043D\u0438\u0445 \u043C\u0435\u0442\u0430\u043B\u0456\u0432"
I.2 11.16.04: "\u041B\u0438\u0432\u0430\u0440\u043D\u0435 \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u043E"
I.2 11.16.06: "\u041F\u043E\u0440\u043E\u0448\u043A\u043E\u0432\u0430 \u043C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u044F \u0442\u0430 \u043A\u043E\u043C\u043F\u043E\u0437\u0438\u0446\u0456\u0439\u043D\u0456 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0438"
I.2 11.16.07: "\u041C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u044F \u0432\u0438\u0441\u043E\u043A\u043E\u0447\u0438\u0441\u0442\u0438\u0445 \u043C\u0435\u0442\u0430\u043B\u0456\u0432 \u0442\u0430 \u0441\u043F\u0435\u0446\u0456\u0430\u043B\u044C\u043D\u0438\u0445 \u0441\u043F\u043B\u0430\u0432\u0456\u0432"
I.2 11.20: "\u0422\u0435\u0445\u043D\u0456\u043A\u0430 \u0432 \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u043E\u043C\u0443 \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0456"
I.2 11.20.01: "\u041C\u0435\u0445\u0430\u043D\u0456\u0437\u0430\u0446\u0456\u044F \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u043E\u0433\u043E \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430"
I.2 11.20.02: "\u0417\u0430\u0441\u0442\u043E\u0441\u0443\u0432\u0430\u043D\u043D\u044F \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u0439 \u0443 \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u043E\u043C\u0443 \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0456"
I.2 11.20.05: "\u0413\u0456\u0434\u0440\u043E\u0442\u0435\u0445\u043D\u0456\u0447\u043D\u0456 \u043C\u0435\u043B\u0456\u043E\u0440\u0430\u0446\u0456\u0457"
I.2 12: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u043F\u0440\u0438\u043B\u0430\u0434\u043E\u0431\u0443\u0434\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u0456\u043A\u0438"
I.2 12.11: "\u041F\u0440\u0438\u043B\u0430\u0434\u0438"
I.2 12.11.01: "\u041F\u0440\u0438\u043B\u0430\u0434\u0438 \u0442\u0430 \u043C\u0435\u0442\u043E\u0434\u0438 \u0432\u0438\u043C\u0456\u0440\u044E\u0432\u0430\u043D\u043D\u044F \u043C\u0435\u0445\u0430\u043D\u0456\u0447\u043D\u0438\u0445\_\u0432\u0435\u043B\u0438\u0447\u0438\u043D"
I.2 12.11.03: "\u0413\u0456\u0440\u043E\u0441\u043A\u043E\u043F\u0438 \u0442\u0430 \u043D\u0430\u0432\u0456\u0433\u0430\u0446\u0456\u0439\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438"
I.2 12.11.04: "\u041F\u0440\u0438\u043B\u0430\u0434\u0438 \u0442\u0430 \u043C\u0435\u0442\u043E\u0434\u0438 \u0432\u0438\u043C\u0456\u0440\u044E\u0432\u0430\u043D\u043D\u044F \u0442\u0435\u043F\u043B\u043E\u0432\u0438\u0445 \u0432\u0435\u043B\u0438\u0447\u0438\u043D"
I.2 12.11.05: "\u041F\u0440\u0438\u043B\u0430\u0434\u0438 \u0442\u0430 \u043C\u0435\u0442\u043E\u0434\u0438 \u0432\u0438\u043C\u0456\u0440\u044E\u0432\u0430\u043D\u043D\u044F \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0447\u043D\u0438\u0445 \u0456 \u043C\u0430\u0433\u043D\u0456\u0442\u043D\u0438\u0445 \u0432\u0435\u043B\u0438\u0447\u0438\u043D"
I.2 12.11.06: "\u0410\u043A\u0443\u0441\u0442\u0438\u0447\u043D\u0456 \u043F\u0440\u0438\u043B\u0430\u0434\u0438 \u0442\u0430 \u0441\u0438\u0441\u0442\u0435\u043C\u0438"
I.2 12.11.07: "\u041E\u043F\u0442\u0438\u0447\u043D\u0456 \u043F\u0440\u0438\u043B\u0430\u0434\u0438 \u0442\u0430 \u0441\u0438\u0441\u0442\u0435\u043C\u0438"
I.2 12.11.08: "\u0420\u0430\u0434\u0456\u043E\u0432\u0438\u043C\u0456\u0440\u044E\u0432\u0430\u043B\u044C\u043D\u0456 \u043F\u0440\u0438\u043B\u0430\u0434\u0438"
I.2 12.11.09: "\u041F\u0440\u0438\u043B\u0430\u0434\u0438 \u0434\u043B\u044F \u0432\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F \u0441\u043A\u043B\u0430\u0434\u0443 \u0440\u0435\u0447\u043E\u0432\u0438\u043D"
I.2 12.11.10: "\u041F\u0440\u0438\u043B\u0430\u0434\u0438 \u0434\u043B\u044F \u0432\u0438\u043C\u0456\u0440\u044E\u0432\u0430\u043D\u043D\u044F \u0456\u043E\u043D\u0456\u0437\u0443\u0432\u0430\u043B\u044C\u043D\u0438\u0445 \u0432\u0438\u043F\u0440\u043E\u043C\u0456\u043D\u0435\u043D\u044C"
I.2 12.11.13: "\u041F\u0440\u0438\u043B\u0430\u0434\u0438 \u0442\u0430 \u043C\u0435\u0442\u043E\u0434\u0438 \u043A\u043E\u043D\u0442\u0440\u043E\u043B\u044E"
I.2 12.11.15: "\u041C\u0435\u0442\u0440\u043E\u043B\u043E\u0433\u0456\u044F \u0442\u0430 \u043C\u0435\u0442\u0440\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0435 \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F"
I.2 12.11.16: "\u0406\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0456\u0439\u043D\u043E-\u0432\u0438\u043C\u0456\u0440\u044E\u0432\u0430\u043B\u044C\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438"
I.2 12.11.17: "\u041C\u0435\u0434\u0438\u0447\u043D\u0456 \u043F\u0440\u0438\u043B\u0430\u0434\u0438 \u0442\u0430 \u0441\u0438\u0441\u0442\u0435\u043C\u0438"
I.2 12.11.19: "\u0410\u0441\u0442\u0440\u043E\u043D\u043E\u043C\u0456\u0447\u043D\u0456 \u0456\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u0438 \u0442\u0430 \u043F\u0440\u0438\u043B\u0430\u0434\u0438"
I.2 12.12: "\u0420\u0430\u0434\u0456\u043E\u0442\u0435\u0445\u043D\u0456\u043A\u0430 \u0456 \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0457"
I.2 12.12.01: "\u0422\u0435\u043E\u0440\u0435\u0442\u0438\u0447\u043D\u0430 \u0440\u0430\u0434\u0456\u043E\u0442\u0435\u0445\u043D\u0456\u043A\u0430"
I.2 12.12.02: "\u0422\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438 \u0442\u0430 \u043A\u0435\u0440\u0443\u0432\u0430\u043D\u043D\u044F \u043D\u0438\u043C\u0438"
I.2 12.12.04: "\u0420\u0430\u0434\u0456\u043E\u043B\u043E\u043A\u0430\u0446\u0456\u044F \u0442\u0430 \u0440\u0430\u0434\u0456\u043E\u043D\u0430\u0432\u0456\u0433\u0430\u0446\u0456\u044F"
I.2 12.12.07: "\u0410\u043D\u0442\u0435\u043D\u0438 \u0442\u0430 \u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u043C\u0456\u043A\u0440\u043E\u0445\u0432\u0438\u043B\u044C\u043E\u0432\u043E\u0457 \u0442\u0435\u0445\u043D\u0456\u043A\u0438"
I.2 12.12.13: "\u041F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0440\u0430\u0434\u0456\u043E\u0442\u0435\u0445\u043D\u0456\u043A\u0438 \u0442\u0430 \u0437\u0430\u0441\u043E\u0431\u0456\u0432 \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439"
I.2 12.12.14: "\u0422\u0435\u043E\u0440\u0456\u044F \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439"
I.2 12.12.17: "\u0420\u0430\u0434\u0456\u043E\u0442\u0435\u0445\u043D\u0456\u0447\u043D\u0456 \u0442\u0430 \u0442\u0435\u043B\u0435\u0432\u0456\u0437\u0456\u0439\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438"
I.2 12.12.20: "\u041E\u043F\u0442\u043E\u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438"
I.2 12.12.21: "\u0420\u0430\u0434\u0456\u043E\u0442\u0435\u0445\u043D\u0456\u0447\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438 \u0441\u043F\u0435\u0446\u0456\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F"
I.2 12.13: "\u041E\u0431\u0447\u0438\u0441\u043B\u044E\u0432\u0430\u043B\u044C\u043D\u0430 \u0442\u0435\u0445\u043D\u0456\u043A\u0430 \u0442\u0430 \u0430\u0432\u0442\u043E\u043C\u0430\u0442\u0438\u0437\u0430\u0446\u0456\u044F"
I.2 12.13.03: "\u0421\u0438\u0441\u0442\u0435\u043C\u0438 \u0442\u0430 \u043F\u0440\u043E\u0446\u0435\u0441\u0438 \u043A\u0435\u0440\u0443\u0432\u0430\u043D\u043D\u044F"
I.2 12.13.05: "\u0415\u043B\u0435\u043C\u0435\u043D\u0442\u0438 \u0442\u0430 \u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u043E\u0431\u0447\u0438\u0441\u043B\u044E\u0432\u0430\u043B\u044C\u043D\u043E\u0457 \u0442\u0435\u0445\u043D\u0456\u043A\u0438 \u0442\u0430 \u0441\u0438\u0441\u0442\u0435\u043C \u043A\u0435\u0440\u0443\u0432\u0430\u043D\u043D\u044F"
I.2 12.13.06: "\u0410\u0432\u0442\u043E\u043C\u0430\u0442\u0438\u0437\u043E\u0432\u0430\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438 \u043A\u0435\u0440\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u043F\u0440\u043E\u0433\u0440\u0435\u0441\u0438\u0432\u043D\u0456 \u0456\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0456\u0439\u043D\u0456 \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u0457"
I.2 12.13.07: "\u0410\u0432\u0442\u043E\u043C\u0430\u0442\u0438\u0437\u0430\u0446\u0456\u044F \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0438\u0445 \u043F\u0440\u043E\u0446\u0435\u0441\u0456\u0432"
I.2 12.13.12: "\u0421\u0438\u0441\u0442\u0435\u043C\u0438 \u0430\u0432\u0442\u043E\u043C\u0430\u0442\u0438\u0437\u0430\u0446\u0456\u0457 \u043F\u0440\u043E\u0435\u043A\u0442\u0443\u0432\u0430\u043D\u043D\u044F"
I.2 12.13.13: "\u041E\u0431\u0447\u0438\u0441\u043B\u044E\u0432\u0430\u043B\u044C\u043D\u0456 \u043C\u0430\u0448\u0438\u043D\u0438, \u0441\u0438\u0441\u0442\u0435\u043C\u0438 \u0442\u0430 \u043C\u0435\u0440\u0435\u0436\u0456"
I.2 12.27: "\u0415\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u0456\u043A\u0430"
I.2 12.27.01: "\u0422\u0432\u0435\u0440\u0434\u043E\u0442\u0456\u043B\u044C\u043D\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u0456\u043A\u0430"
I.2 12.27.02: "\u0412\u0430\u043A\u0443\u0443\u043C\u043D\u0430, \u043F\u043B\u0430\u0437\u043C\u043E\u0432\u0430 \u0442\u0430 \u043A\u0432\u0430\u043D\u0442\u043E\u0432\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u0456\u043A\u0430"
I.2 12.27.06: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F, \u043E\u0431\u043B\u0430\u0434\u043D\u0430\u043D\u043D\u044F \u0442\u0430 \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u043E \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u043E\u0457 \u0442\u0435\u0445\u043D\u0456\u043A\u0438"
I.2 13: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0435\u043D\u0435\u0440\u0433\u0435\u0442\u0438\u043A\u0438"
I.2 13.14: "\u0415\u043D\u0435\u0440\u0433\u0435\u0442\u0438\u043A\u0430"
I.2 13.14.01: "\u0415\u043D\u0435\u0440\u0433\u0435\u0442\u0438\u0447\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438 \u0442\u0430 \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u0438"
I.2 13.14.02: "\u0415\u043B\u0435\u043A\u0442\u0440\u0438\u0447\u043D\u0456 \u0441\u0442\u0430\u043D\u0446\u0456\u0457, \u043C\u0435\u0440\u0435\u0436\u0456 \u0442\u0430 \u0441\u0438\u0441\u0442\u0435\u043C\u0438"
I.2 13.14.04: "\u041F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0430 \u0442\u0435\u043F\u043B\u043E\u0435\u043D\u0435\u0440\u0433\u0435\u0442\u0438\u043A\u0430"
I.2 13.14.05: "\u0422\u0435\u043E\u0440\u0435\u0442\u0438\u0447\u043D\u0430 \u0442\u0435\u043F\u043B\u043E\u0442\u0435\u0445\u043D\u0456\u043A\u0430"
I.2 13.14.06: "\u0422\u0435\u0445\u043D\u0456\u0447\u043D\u0430 \u0442\u0435\u043F\u043B\u043E\u0444\u0456\u0437\u0438\u043A\u0430"
I.2 13.14.08: "\u041F\u0435\u0440\u0435\u0442\u0432\u043E\u0440\u0435\u043D\u043D\u044F \u0432\u0456\u0434\u043D\u043E\u0432\u043B\u044E\u0432\u0430\u043D\u0438\u0445 \u0432\u0438\u0434\u0456\u0432 \u0435\u043D\u0435\u0440\u0433\u0456\u0457"
I.2 13.14.14: "\u0422\u0435\u043F\u043B\u043E\u0432\u0456 \u0442\u0430 \u044F\u0434\u0435\u0440\u043D\u0456 \u0435\u043D\u0435\u0440\u0433\u043E\u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438"
I.2 13.14.15: "\u0415\u043B\u0435\u043A\u0442\u0440\u043E\u0445\u0456\u043C\u0456\u0447\u043D\u0456 \u0435\u043D\u0435\u0440\u0433\u043E\u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438"
I.2 14: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0433\u0435\u043E\u0434\u0435\u0437\u0456\u0457 \u0456 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u043A\u043E\u0440\u0438\u0441\u043D\u0438\u0445 \u043A\u043E\u043F\u0430\u043B\u0438\u043D"
I.2 14.15: "\u0420\u043E\u0437\u0440\u043E\u0431\u043A\u0430 \u043A\u043E\u0440\u0438\u0441\u043D\u0438\u0445 \u043A\u043E\u043F\u0430\u043B\u0438\u043D"
I.2 14.15.01: "\u041C\u0430\u0440\u043A\u0448\u0435\u0439\u0434\u0435\u0440\u0456\u044F"
I.2 14.15.02: "\u041F\u0456\u0434\u0437\u0435\u043C\u043D\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0430 \u0440\u043E\u0434\u043E\u0432\u0438\u0449 \u043A\u043E\u0440\u0438\u0441\u043D\u0438\u0445 \u043A\u043E\u043F\u0430\u043B\u0438\u043D"
I.2 14.15.03: "\u0412\u0456\u0434\u043A\u0440\u0438\u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0430 \u0440\u043E\u0434\u043E\u0432\u0438\u0449 \u043A\u043E\u0440\u0438\u0441\u043D\u0438\u0445 \u043A\u043E\u043F\u0430\u043B\u0438\u043D"
I.2 14.15.04: "\u0428\u0430\u0445\u0442\u043D\u0435 \u0442\u0430 \u043F\u0456\u0434\u0437\u0435\u043C\u043D\u0435 \u0431\u0443\u0434\u0456\u0432\u043D\u0438\u0446\u0442\u0432\u043E"
I.2 14.15.05: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0442\u043E\u0440\u0444'\u044F\u043D\u043E\u0433\u043E \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430"
I.2 14.15.06: "\u0420\u043E\u0437\u0440\u043E\u0431\u043A\u0430 \u043D\u0430\u0444\u0442\u043E\u0432\u0438\u0445 \u0456 \u0433\u0430\u0437\u043E\u0432\u0438\u0445 \u0440\u043E\u0434\u043E\u0432\u0438\u0449"
I.2 14.15.08: "\u0417\u0431\u0430\u0433\u0430\u0447\u0435\u043D\u043D\u044F \u043A\u043E\u0440\u0438\u0441\u043D\u0438\u0445 \u043A\u043E\u043F\u0430\u043B\u0438\u043D"
I.2 14.15.09: "\u041C\u0435\u0445\u0430\u043D\u0456\u043A\u0430 \u0433\u0440\u0443\u043D\u0442\u0456\u0432 \u0442\u0430 \u0433\u0456\u0440\u0441\u044C\u043A\u0438\u0445 \u043F\u043E\u0440\u0456\u0434"
I.2 14.15.10: "\u0411\u0443\u0440\u0456\u043D\u043D\u044F \u0441\u0432\u0435\u0440\u0434\u043B\u043E\u0432\u0438\u043D"
I.2 14.15.11: "\u0424\u0456\u0437\u0438\u0447\u043D\u0456 \u043F\u0440\u043E\u0446\u0435\u0441\u0438 \u0433\u0456\u0440\u043D\u0438\u0447\u043E\u0433\u043E \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430"
I.2 14.15.12: "\u0420\u043E\u0437\u0440\u043E\u0431\u043A\u0430 \u043C\u043E\u0440\u0441\u044C\u043A\u0438\u0445 \u0440\u043E\u0434\u043E\u0432\u0438\u0449 \u043A\u043E\u0440\u0438\u0441\u043D\u0438\u0445 \u043A\u043E\u043F\u0430\u043B\u0438\u043D"
I.2 14.15.13: "\u041D\u0430\u0444\u0442\u043E\u0433\u0430\u0437\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438, \u0431\u0430\u0437\u0438 \u0442\u0430 \u0441\u0445\u043E\u0432\u0438\u0449\u0430"
I.2 14.15.14: "\u0413\u0435\u043E\u043B\u043E\u0433\u043E\u0440\u043E\u0437\u0432\u0456\u0434\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u0440\u043E\u0431\u043E\u0442\u0438"
I.2 14.24: "\u0413\u0435\u043E\u0434\u0435\u0437\u0438\u0447\u043D\u0456 \u043D\u0430\u0443\u043A\u0438"
I.2 14.24.01: "\u0413\u0435\u043E\u0434\u0435\u0437\u0456\u044F"
I.2 14.24.02: "\u0424\u043E\u0442\u043E\u0433\u0440\u0430\u043C\u043C\u0435\u0442\u0440\u0456\u044F, \u0444\u043E\u0442\u043E\u0442\u043E\u043F\u043E\u0433\u0440\u0430\u0444\u0456\u044F"
I.2 14.24.04: "\u041A\u0430\u0434\u0430\u0441\u0442\u0440 \u0456 \u043C\u043E\u043D\u0456\u0442\u043E\u0440\u0438\u043D\u0433 \u0437\u0435\u043C\u0435\u043B\u044C"
I.2 15: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0445\u0456\u043C\u0456\u0447\u043D\u0438\u0445 \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u0439"
I.2 15.17: "\u0425\u0456\u043C\u0456\u0447\u043D\u0456 \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u0457"
I.2 15.17.01: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043D\u0435\u043E\u0440\u0433\u0430\u043D\u0456\u0447\u043D\u0438\u0445 \u0440\u0435\u0447\u043E\u0432\u0438\u043D"
I.2 15.17.02: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0440\u0456\u0434\u043A\u0456\u0441\u043D\u0438\u0445 \u0442\u0430 \u0440\u043E\u0437\u0441\u0456\u044F\u043D\u0438\u0445 \u0435\u043B\u0435\u043C\u0435\u043D\u0442\u0456\u0432"
I.2 15.17.03: "\u0422\u0435\u0445\u043D\u0456\u0447\u043D\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0445\u0456\u043C\u0456\u044F"
I.2 15.17.04: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 \u043E\u0440\u0433\u0430\u043D\u0456\u0447\u043D\u043E\u0433\u043E \u0441\u0438\u043D\u0442\u0435\u0437\u0443"
I.2 15.17.06: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043F\u043E\u043B\u0456\u043C\u0435\u0440\u043D\u0438\u0445 \u0456 \u043A\u043E\u043C\u043F\u043E\u0437\u0438\u0446\u0456\u0439\u043D\u0438\u0445 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432"
I.2 15.17.07: "\u0425\u0456\u043C\u0456\u0447\u043D\u0430 \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043F\u0430\u043B\u0438\u0432\u0430"
I.2 15.17.09: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043B\u0430\u043A\u0456\u0432, \u0444\u0430\u0440\u0431 \u0442\u0430 \u043E\u0440\u0433\u0430\u043D\u0456\u0447\u043D\u0438\u0445 \u043F\u043E\u043A\u0440\u0438\u0442\u0442\u0456\u0432"
I.2 15.17.11: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0442\u0443\u0433\u043E\u043F\u043B\u0430\u0432\u043A\u0438\u0445 \u043D\u0435\u043C\u0435\u0442\u0430\u043B\u0435\u0432\u0438\u0445 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432"
I.2 15.17.13: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043A\u0456\u043D\u043E\u0444\u043E\u0442\u043E\u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432 \u0456 \u043C\u0430\u0433\u043D\u0456\u0442\u043D\u0438\u0445 \u043D\u043E\u0441\u0456\u0457\u0432"
I.2 15.17.14: "\u0425\u0456\u043C\u0456\u0447\u043D\u0438\u0439 \u043E\u043F\u0456\u0440 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432 \u0442\u0430 \u0437\u0430\u0445\u0438\u0441\u0442 \u0432\u0456\u0434 \u043A\u043E\u0440\u043E\u0437\u0456\u0457"
I.2 15.17.15: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0445\u0456\u043C\u0456\u0447\u043D\u0438\u0445 \u0432\u043E\u043B\u043E\u043A\u043E\u043D \u0442\u0430 \u043F\u043B\u0456\u0432\u043E\u043A"
I.2 15.17.18: "\u041C\u0435\u043C\u0431\u0440\u0430\u043D\u0438 \u0442\u0430 \u043C\u0435\u043C\u0431\u0440\u0430\u043D\u043D\u0430 \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F"
I.2 15.17.19: "\u0425\u0456\u043C\u0456\u0447\u043D\u0430 \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0432\u0438\u0441\u043E\u043A\u043E\u0442\u0435\u043C\u043F\u0435\u0440\u0430\u0442\u0443\u0440\u043D\u0438\u0445 \u043D\u0430\u0434\u043F\u0440\u043E\u0432\u0456\u0434\u043D\u0438\u043A\u0456\u0432"
I.2 15.17.21: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0432\u043E\u0434\u043E\u043E\u0447\u0438\u0449\u0435\u043D\u043D\u044F"
I.2 15.17.22: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0442\u0430 \u043E\u0431\u043B\u0430\u0434\u043D\u0430\u043D\u043D\u044F \u0445\u0456\u043C\u0456\u0447\u043D\u043E\u0433\u043E \u043F\u0435\u0440\u0435\u0440\u043E\u0431\u043B\u0435\u043D\u043D\u044F \u0434\u0435\u0440\u0435\u0432\u0438\u043D\u0438"
I.2 16: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u0457 \u043F\u0440\u043E\u0434\u043E\u0432\u043E\u043B\u044C\u0447\u0438\u0445 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432"
I.2 16.18: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u0457 \u043F\u0440\u043E\u0434\u043E\u0432\u043E\u043B\u044C\u0447\u0438\u0445 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432"
I.2 16.18.01: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0445\u043B\u0456\u0431\u043E\u043F\u0435\u043A\u0430\u0440\u0441\u044C\u043A\u0438\u0445 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 \u0442\u0430 \u0445\u0430\u0440\u0447\u043E\u0432\u0438\u0445 \u043A\u043E\u043D\u0446\u0435\u043D\u0442\u0440\u0430\u0442\u0456\u0432"
I.2 16.18.02: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0437\u0435\u0440\u043D\u043E\u0432\u0438\u0445, \u0431\u043E\u0431\u043E\u0432\u0438\u0445, \u043A\u0440\u0443\u043F'\u044F\u043D\u0438\u0445 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 \u0442\u0430 \u043A\u043E\u043C\u0431\u0456\u043A\u043E\u0440\u043C\u0456\u0432"
I.2 16.18.03: "\u041F\u0435\u0440\u0432\u0438\u043D\u043D\u0435 \u043E\u0431\u0440\u043E\u0431\u043B\u0435\u043D\u043D\u044F \u0442\u0430 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u043D\u043D\u044F \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 \u0440\u043E\u0441\u043B\u0438\u043D\u043D\u0438\u0446\u0442\u0432\u0430"
I.2 16.18.04: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043C'\u044F\u0441\u043D\u0438\u0445, \u043C\u043E\u043B\u043E\u0447\u043D\u0438\u0445 \u0442\u0430 \u0440\u0438\u0431\u043D\u0438\u0445 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432"
I.2 16.18.05: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0446\u0443\u043A\u0440\u0438\u0441\u0442\u0438\u0445 \u0440\u0435\u0447\u043E\u0432\u0438\u043D"
I.2 16.18.06: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0436\u0438\u0440\u0456\u0432, \u0435\u0444\u0456\u0440\u043D\u0438\u0445 \u043E\u043B\u0456\u0439 \u0456 \u043F\u0430\u0440\u0444\u0443\u043C\u0435\u0440\u043D\u043E-\u043A\u043E\u0441\u043C\u0435\u0442\u0438\u0447\u043D\u0438\u0445 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432"
I.2 16.18.07: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 \u0431\u0440\u043E\u0434\u0456\u043D\u043D\u044F"
I.2 16.18.13: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043A\u043E\u043D\u0441\u0435\u0440\u0432\u043E\u0432\u0430\u043D\u0438\u0445 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432"
I.2 16.18.14: "\u0425\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u0430 \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0445\u0430\u0440\u0447\u043E\u0432\u0438\u0445 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432"
I.2 16.18.15: "\u0422\u043E\u0432\u0430\u0440\u043E\u0437\u043D\u0430\u0432\u0441\u0442\u0432\u043E \u0445\u0430\u0440\u0447\u043E\u0432\u0438\u0445 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432"
I.2 16.18.16: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 \u0445\u0430\u0440\u0447\u0443\u0432\u0430\u043D\u043D\u044F"
I.2 16.18.17: "\u041F\u0440\u043E\u043C\u0438\u0441\u0435\u043B \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 \u043C\u043E\u0440\u0441\u044C\u043A\u0438\u0445 \u0442\u0430 \u043F\u0440\u0456\u0441\u043D\u0438\u0445 \u0432\u043E\u0434\u043E\u0439\u043C\u0438\u0449"
I.2 17: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0442\u0435\u043A\u0441\u0442\u0438\u043B\u044C\u043D\u043E\u0457 \u0442\u0430 \u043B\u0435\u0433\u043A\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
I.2 17.19: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u0457 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432 \u0442\u0430 \u0432\u0438\u0440\u043E\u0431\u0456\u0432 \u0442\u0435\u043A\u0441\u0442\u0438\u043B\u044C\u043D\u043E\u0457 \u0442\u0430 \u043B\u0435\u0433\u043A\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
I.2 17.19.03: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0442\u0435\u043A\u0441\u0442\u0438\u043B\u044C\u043D\u0438\u0445 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432"
I.2 17.19.04: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0448\u0432\u0435\u0439\u043D\u0438\u0445 \u0432\u0438\u0440\u043E\u0431\u0456\u0432"
I.2 17.19.05: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0448\u043A\u0456\u0440\u0438 \u0442\u0430 \u0445\u0443\u0442\u0440\u0430"
I.2 17.19.06: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u0432\u0437\u0443\u0442\u0442\u0454\u0432\u0438\u0445 \u0442\u0430 \u0448\u043A\u0456\u0440\u044F\u043D\u0438\u0445 \u0432\u0438\u0440\u043E\u0431\u0456\u0432"
I.2 17.19.08: "\u0422\u043E\u0432\u0430\u0440\u043E\u0437\u043D\u0430\u0432\u0441\u0442\u0432\u043E \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0438\u0445 \u0442\u043E\u0432\u0430\u0440\u0456\u0432"
I.2 18: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
I.2 18.22: "\u0422\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442"
I.2 18.22.01: "\u0422\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438"
I.2 18.22.02: "\u0410\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u0456 \u0442\u0430 \u0442\u0440\u0430\u043A\u0442\u043E\u0440\u0438"
I.2 18.22.06: "\u0417\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0430 \u043A\u043E\u043B\u0456\u044F"
I.2 18.22.07: "\u0420\u0443\u0445\u043E\u043C\u0438\u0439 \u0441\u043A\u043B\u0430\u0434 \u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0446\u044C \u0456 \u0442\u044F\u0433\u0430 \u043F\u043E\u0457\u0437\u0434\u0456\u0432"
I.2 18.22.08: "\u0415\u043A\u0441\u043F\u043B\u0443\u0430\u0442\u0430\u0446\u0456\u044F \u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
I.2 18.22.09: "\u0415\u043B\u0435\u043A\u0442\u0440\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u044F \u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
I.2 18.22.10: "\u0415\u043A\u0441\u043F\u043B\u0443\u0430\u0442\u0430\u0446\u0456\u044F \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
I.2 18.22.11: "\u0410\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u0456 \u0448\u043B\u044F\u0445\u0438 \u0442\u0430 \u0430\u0435\u0440\u043E\u0434\u0440\u043E\u043C\u0438"
I.2 18.22.12: "\u041F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0438\u0439 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442"
I.2 18.22.13: "\u041D\u0430\u0432\u0456\u0433\u0430\u0446\u0456\u044F \u0442\u0430 \u043A\u0435\u0440\u0443\u0432\u0430\u043D\u043D\u044F \u043F\u043E\u0432\u0456\u0442\u0440\u044F\u043D\u0438\u043C \u0440\u0443\u0445\u043E\u043C"
I.2 18.22.14: "\u0415\u043A\u0441\u043F\u043B\u0443\u0430\u0442\u0430\u0446\u0456\u044F \u043F\u043E\u0432\u0456\u0442\u0440\u044F\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
I.2 18.22.16: "\u0421\u0443\u0434\u043D\u043E\u0432\u043E\u0434\u0456\u043D\u043D\u044F"
I.2 18.22.19: "\u0415\u043A\u0441\u043F\u043B\u0443\u0430\u0442\u0430\u0446\u0456\u044F \u0432\u043E\u0434\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
I.2 18.22.20: "\u0412\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u043E \u0442\u0430 \u0440\u0435\u043C\u043E\u043D\u0442 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u0438\u0445 \u0437\u0430\u0441\u043E\u0431\u0456\u0432"
I.2 19: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0430\u0440\u0445\u0456\u0442\u0435\u043A\u0442\u0443\u0440\u0438 \u0442\u0430 \u0431\u0443\u0434\u0456\u0432\u043D\u0438\u0446\u0442\u0432\u0430"
I.2 19.00: "\u0410\u0440\u0445\u0456\u0442\u0435\u043A\u0442\u0443\u0440\u0430"
I.2 19.00.01: "\u0422\u0435\u043E\u0440\u0456\u044F \u0430\u0440\u0445\u0456\u0442\u0435\u043A\u0442\u0443\u0440\u0438, \u0440\u0435\u0441\u0442\u0430\u0432\u0440\u0430\u0446\u0456\u044F \u043F\u0430\u043C'\u044F\u0442\u043E\u043A \u0430\u0440\u0445\u0456\u0442\u0435\u043A\u0442\u0443\u0440\u0438"
I.2 19.00.02: "\u0410\u0440\u0445\u0456\u0442\u0435\u043A\u0442\u0443\u0440\u0430 \u0431\u0443\u0434\u0456\u0432\u0435\u043B\u044C \u0442\u0430 \u0441\u043F\u043E\u0440\u0443\u0434"
I.2 19.00.03: "\u041C\u0456\u0441\u0442\u043E\u0431\u0443\u0434\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u043B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u0430 \u0430\u0440\u0445\u0456\u0442\u0435\u043A\u0442\u0443\u0440\u0430"
I.2 19.23: "\u0411\u0443\u0434\u0456\u0432\u043D\u0438\u0446\u0442\u0432\u043E"
I.2 19.23.01: "\u0411\u0443\u0434\u0456\u0432\u0435\u043B\u044C\u043D\u0456 \u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0456\u0457, \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0442\u0430 \u0441\u043F\u043E\u0440\u0443\u0434\u0438"
I.2 19.23.02: "\u041F\u0456\u0434\u0432\u0430\u043B\u0438\u043D\u0438 \u0442\u0430 \u0444\u0443\u043D\u0434\u0430\u043C\u0435\u043D\u0442\u0438"
I.2 19.23.03: "\u0412\u0435\u043D\u0442\u0438\u043B\u044F\u0446\u0456\u044F, \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F \u0456 \u0442\u0435\u043F\u043B\u043E\u0433\u0430\u0437\u043E\u043F\u043E\u0441\u0442\u0430\u0447\u0430\u043D\u043D\u044F"
I.2 19.23.04: "\u0412\u043E\u0434\u043E\u043F\u043E\u0441\u0442\u0430\u0447\u0430\u043D\u043D\u044F, \u043A\u0430\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u044F"
I.2 19.23.05: "\u0411\u0443\u0434\u0456\u0432\u0435\u043B\u044C\u043D\u0456 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0438 \u0442\u0430 \u0432\u0438\u0440\u043E\u0431\u0438"
I.2 19.23.08: "\u0422\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u044F \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0433\u043E \u0442\u0430 \u0446\u0438\u0432\u0456\u043B\u044C\u043D\u043E\u0433\u043E \u0431\u0443\u0434\u0456\u0432\u043D\u0438\u0446\u0442\u0432\u0430"
I.2 19.23.16: "\u0413\u0456\u0434\u0440\u0430\u0432\u043B\u0456\u043A\u0430 \u0442\u0430 \u0456\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u0430 \u0433\u0456\u0434\u0440\u043E\u043B\u043E\u0433\u0456\u044F"
I.2 19.23.17: "\u0411\u0443\u0434\u0456\u0432\u0435\u043B\u044C\u043D\u0430 \u043C\u0435\u0445\u0430\u043D\u0456\u043A\u0430"
I.2 20: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0438\u0445 \u043D\u0430\u0443\u043A"
I.2 20.01: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u043E-\u0442\u0435\u043E\u0440\u0435\u0442\u0438\u0447\u043D\u0456 \u043D\u0430\u0443\u043A\u0438"
I.2 20.01.01: "\u041E\u0441\u043D\u043E\u0432\u0438 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u043E\u0457 \u043D\u0430\u0443\u043A\u0438"
I.2 20.01.02: "\u0421\u0442\u0440\u0430\u0442\u0435\u0433\u0456\u044F"
I.2 20.01.03: "\u041E\u043F\u0435\u0440\u0430\u0442\u0438\u0432\u043D\u0435 \u043C\u0438\u0441\u0442\u0435\u0446\u0442\u0432\u043E"
I.2 20.01.04: "\u0422\u0430\u043A\u0442\u0438\u043A\u0430"
I.2 20.01.05: "\u0411\u0443\u0434\u0456\u0432\u043D\u0438\u0446\u0442\u0432\u043E \u0417\u0431\u0440\u043E\u0439\u043D\u0438\u0445 \u0421\u0438\u043B"
I.2 20.01.06: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0435 \u043D\u0430\u0432\u0447\u0430\u043D\u043D\u044F \u0442\u0430 \u0432\u0438\u0445\u043E\u0432\u0430\u043D\u043D\u044F, \u0431\u043E\u0439\u043E\u0432\u0430 \u0442\u0430 \u043E\u043F\u0435\u0440\u0430\u0442\u0438\u0432\u043D\u0430 \u043F\u0456\u0434\u0433\u043E\u0442\u043E\u0432\u043A\u0430"
I.2 20.01.07: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0430 \u0435\u043A\u043E\u043D\u043E\u043C\u0456\u043A\u0430"
I.2 20.01.08: "\u0422\u0438\u043B \u0417\u0431\u0440\u043E\u0439\u043D\u0438\u0445 \u0421\u0438\u043B"
I.2 20.01.09: "\u0421\u0438\u0441\u0442\u0435\u043C\u0438 \u043A\u0435\u0440\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u0437\u0432'\u044F\u0437\u043E\u043A"
I.2 20.01.10: "\u0420\u043E\u0437\u0432\u0456\u0434\u043A\u0430 \u0442\u0430 \u0456\u043D\u043E\u0437\u0435\u043C\u043D\u0456 \u0430\u0440\u043C\u0456\u0457, \u0437\u0430\u0441\u043E\u0431\u0438 \u0440\u043E\u0437\u0432\u0456\u0434\u043A\u0438"
I.2 20.01.12: "\u0420\u0430\u0434\u0456\u043E\u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u0430 \u0431\u043E\u0440\u043E\u0442\u044C\u0431\u0430, \u0441\u043F\u043E\u0441\u043E\u0431\u0438 \u0442\u0430 \u0437\u0430\u0441\u043E\u0431\u0438"
I.2 20.01.14: "\u0406\u0441\u0442\u043E\u0440\u0456\u044F \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u043E\u0433\u043E \u043C\u0438\u0441\u0442\u0435\u0446\u0442\u0432\u0430"
I.2 20.02: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u043E-\u0441\u043F\u0435\u0446\u0456\u0430\u043B\u044C\u043D\u0456 \u043D\u0430\u0443\u043A\u0438"
I.2 20.02.02: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0430 \u043F\u0435\u0434\u0430\u0433\u043E\u0433\u0456\u043A\u0430 \u0442\u0430 \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0456\u044F"
I.2 20.02.03: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0435 \u043F\u0440\u0430\u0432\u043E, \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0456 \u043F\u0440\u043E\u0431\u043B\u0435\u043C\u0438 \u043C\u0456\u0436\u043D\u0430\u0440\u043E\u0434\u043D\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
I.2 20.02.04: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0430 \u0433\u0435\u043E\u0433\u0440\u0430\u0444\u0456\u044F, \u0442\u0435\u0430\u0442\u0440\u0438 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0438\u0445 \u0434\u0456\u0439, \u043A\u0440\u0430\u0457\u043D\u043E\u0437\u043D\u0430\u0432\u0441\u0442\u0432\u043E, \u043A\u043E\u0441\u043C\u043E\u0433\u0440\u0430\u0444\u0456\u044F"
I.2 20.02.05: "\u0406\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u0435 \u043E\u0431\u043B\u0430\u0434\u043D\u0430\u043D\u043D\u044F \u0442\u0435\u0430\u0442\u0440\u0456\u0432 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0438\u0445 \u0434\u0456\u0439"
I.2 20.02.06: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u043E-\u0431\u0443\u0434\u0456\u0432\u0435\u043B\u044C\u043D\u0456 \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u0438 \u0442\u0430 \u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0456\u0457"
I.2 20.02.07: "\u0421\u0438\u0441\u0442\u0435\u043C\u0438 \u0442\u0435\u0445\u043D\u0456\u0447\u043D\u043E\u0433\u043E \u043E\u0431\u043B\u0430\u0434\u043D\u0430\u043D\u043D\u044F \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u043E-\u0431\u0443\u0434\u0456\u0432\u0435\u043B\u044C\u043D\u0438\u0445 \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u0456\u0432"
I.2 20.02.08: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0456 \u0434\u043E\u0440\u043E\u0433\u0438, \u043C\u043E\u0441\u0442\u0438 \u0442\u0430 \u043F\u0435\u0440\u0435\u043F\u0440\u0430\u0432\u0438"
I.2 20.02.09: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0430 \u0433\u0435\u043E\u0434\u0435\u0437\u0456\u044F, \u0442\u043E\u043F\u043E\u0433\u0440\u0430\u0444\u0456\u044F, \u043A\u0430\u0440\u0442\u043E\u0433\u0440\u0430\u0444\u0456\u044F, \u0444\u043E\u0442\u043E\u0442\u043E\u043F\u043E\u0433\u0440\u0430\u0444\u0456\u044F"
I.2 20.02.10: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0430 \u0433\u0456\u0434\u0440\u043E\u0433\u0440\u0430\u0444\u0456\u044F, \u043C\u0435\u0442\u0435\u043E\u0440\u043E\u043B\u043E\u0433\u0456\u044F \u0442\u0430 \u0433\u0435\u043E\u0444\u0456\u0437\u0438\u043A\u0430"
I.2 20.02.11: "\u0417\u0430\u0441\u043E\u0431\u0438 \u0442\u0430 \u043C\u0435\u0442\u043E\u0434\u0438 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u043E\u0457 \u043D\u0430\u0432\u0456\u0433\u0430\u0446\u0456\u0457"
I.2 20.02.12: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0430 \u043A\u0456\u0431\u0435\u0440\u043D\u0435\u0442\u0438\u043A\u0430, \u0456\u043D\u0444\u043E\u0440\u043C\u0430\u0442\u0438\u043A\u0430, \u0441\u0438\u0441\u0442\u0435\u043C\u043D\u0438\u0439 \u0430\u043D\u0430\u043B\u0456\u0437, \u0434\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u043E\u043F\u0435\u0440\u0430\u0446\u0456\u0439"
I.2 20.02.13: "\u0421\u0442\u0430\u043D\u0434\u0430\u0440\u0442\u0438\u0437\u0430\u0446\u0456\u044F \u0442\u0430 \u043C\u0435\u0442\u0440\u043E\u043B\u043E\u0433\u0456\u044F \u043E\u0437\u0431\u0440\u043E\u0454\u043D\u043D\u044F \u0442\u0430 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u043E\u0457 \u0442\u0435\u0445\u043D\u0456\u043A\u0438"
I.2 20.02.14: "\u041E\u0437\u0431\u0440\u043E\u0454\u043D\u043D\u044F \u0442\u0430 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0430 \u0442\u0435\u0445\u043D\u0456\u043A\u0430"
I.2 20.02.15: "\u0413\u0456\u0434\u0440\u043E\u0430\u0435\u0440\u043E\u0434\u0438\u043D\u0430\u043C\u0456\u043A\u0430, \u0434\u0438\u043D\u0430\u043C\u0456\u043A\u0430 \u0440\u0443\u0445\u0443 \u0442\u0430 \u043C\u0430\u043D\u0435\u0432\u0440\u0443\u0432\u0430\u043D\u043D\u044F \u0431\u043E\u0439\u043E\u0432\u0438\u0445 \u0437\u0430\u0441\u043E\u0431\u0456\u0432"
I.2 20.02.16: "\u0412\u0438\u043F\u0440\u043E\u0431\u0443\u0432\u0430\u043D\u043D\u044F \u043E\u0437\u0431\u0440\u043E\u0454\u043D\u043D\u044F \u0442\u0430 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u043E\u0457 \u0442\u0435\u0445\u043D\u0456\u043A\u0438"
I.2 20.02.17: "\u0415\u043A\u0441\u043F\u043B\u0443\u0430\u0442\u0430\u0446\u0456\u044F \u0456 \u0432\u0456\u0434\u043D\u043E\u0432\u043B\u0435\u043D\u043D\u044F \u043E\u0437\u0431\u0440\u043E\u0454\u043D\u043D\u044F \u0442\u0430 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u043E\u0457 \u0442\u0435\u0445\u043D\u0456\u043A\u0438"
I.2 20.02.18: "\u0417\u0430\u0445\u0438\u0441\u0442 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u043E\u0457 \u0442\u0435\u0445\u043D\u0456\u043A\u0438 \u0432\u0456\u0434 \u0437\u0430\u0441\u043E\u0431\u0456\u0432 \u0432\u0438\u044F\u0432\u043B\u0435\u043D\u043D\u044F"
I.2 20.02.19: "\u0421\u043F\u0435\u0446\u0456\u0430\u043B\u044C\u043D\u0456 \u043F\u0430\u043B\u0438\u0432\u0430 \u0442\u0430 \u043F\u0430\u043B\u0438\u0432\u043D\u043E-\u043C\u0430\u0441\u0442\u0438\u043B\u044C\u043D\u0456 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0438"
I.2 20.02.20: "\u0422\u0435\u043E\u0440\u0456\u044F \u0441\u0442\u0440\u0456\u043B\u044C\u0431\u0438"
I.2 20.02.21: "\u0411\u043E\u0454\u043F\u0440\u0438\u043F\u0430\u0441\u0438"
I.2 20.02.22: "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0430 \u0456\u0441\u0442\u043E\u0440\u0456\u044F"
I.2 20.02.23: "\u0417\u0430\u0441\u043E\u0431\u0438 \u0437\u0430\u0445\u0438\u0441\u0442\u0443 \u0432\u0456\u0434 \u0437\u0431\u0440\u043E\u0457 \u043C\u0430\u0441\u043E\u0432\u043E\u0433\u043E \u0443\u0440\u0430\u0436\u0435\u043D\u043D\u044F"
I.21: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0442\u0435\u0445\u043D\u0456\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.21.00: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0437\u0430\u0433\u0430\u043B\u044C\u043D\u043E\u0442\u0435\u0445\u043D\u0456\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.21.00.1: "\u041F\u0440\u0438\u043A\u043B\u0430\u0434\u043D\u0430 \u0433\u0435\u043E\u043C\u0435\u0442\u0440\u0456\u044F, \u0456\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u0430 \u0433\u0440\u0430\u0444\u0456\u043A\u0430 \u0442\u0430 \u0435\u0440\u0433\u043E\u043D\u043E\u043C\u0456\u043A\u0430"
I.21.02: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0437\u0430\u0433\u0430\u043B\u044C\u043D\u043E\u0442\u0435\u0445\u043D\u0456\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
I.21.10: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u043C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u0457, \u043E\u0431\u0440\u043E\u0431\u043A\u0438 \u043C\u0435\u0442\u0430\u043B\u0456\u0432, \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430 \u043C\u0430\u0448\u0438\u043D \u0442\u0430 \u0443\u0441\u0442\u0430\u0442\u043A\u0443\u0432\u0430\u043D\u043D\u044F"
I.21.11: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u043C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u0457, \u043E\u0431\u0440\u043E\u0431\u043A\u0438 \u043C\u0435\u0442\u0430\u043B\u0456\u0432, \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430 \u043C\u0430\u0448\u0438\u043D \u0442\u0430 \u0443\u0441\u0442\u0430\u0442\u043A\u0443\u0432\u0430\u043D\u043D\u044F"
I.21.12: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u043C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u0457, \u043E\u0431\u0440\u043E\u0431\u043A\u0438 \u043C\u0435\u0442\u0430\u043B\u0456\u0432, \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430 \u043C\u0430\u0448\u0438\u043D \u0442\u0430 \u0443\u0441\u0442\u0430\u0442\u043A\u0443\u0432\u0430\u043D\u043D\u044F"
I.21.21: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u043F\u0440\u0438\u043B\u0430\u0434\u043E\u0431\u0443\u0434\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u0456\u043A\u0438"
I.21.22: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u043F\u0440\u0438\u043B\u0430\u0434\u043E\u0431\u0443\u0434\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u0456\u043A\u0438"
I.21.31: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0435\u043D\u0435\u0440\u0433\u0435\u0442\u0438\u043A\u0438"
I.21.41: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0433\u0435\u043E\u0434\u0435\u0437\u0456\u0457 \u0456 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u043A\u043E\u0440\u0438\u0441\u043D\u0438\u0445 \u043A\u043E\u043F\u0430\u043B\u0438\u043D"
I.21.42: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0433\u0435\u043E\u0434\u0435\u0437\u0456\u0457 \u0456 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u043A\u043E\u0440\u0438\u0441\u043D\u0438\u0445 \u043A\u043E\u043F\u0430\u043B\u0438\u043D"
I.21.51: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0445\u0456\u043C\u0456\u0447\u043D\u0438\u0445 \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u0439"
I.21.61: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u0457 \u043F\u0440\u043E\u0434\u043E\u0432\u043E\u043B\u044C\u0447\u0438\u0445 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432"
I.21.71: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0442\u0435\u043A\u0441\u0442\u0438\u043B\u044C\u043D\u043E\u0457 \u0442\u0430 \u043B\u0435\u0433\u043A\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
I.21.82: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
I.21.90: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0430\u0440\u0445\u0456\u0442\u0435\u043A\u0442\u0443\u0440\u0438 \u0442\u0430 \u0431\u0443\u0434\u0456\u0432\u043D\u0438\u0446\u0442\u0432\u0430"
I.21.92: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0430\u0440\u0445\u0456\u0442\u0435\u043A\u0442\u0443\u0440\u0438 \u0442\u0430 \u0431\u0443\u0434\u0456\u0432\u043D\u0438\u0446\u0442\u0432\u0430"
I.22: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0438\u0445 \u043D\u0430\u0443\u043A"
I.22.00: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0438\u0445 \u043D\u0430\u0443\u043A"
II: "\u0414\u041E\u0421\u041B\u0406\u0414\u0416\u0415\u041D\u041D\u042F \u0422\u0410 \u0420\u041E\u0417\u0420\u041E\u0411\u041A\u0418 \u0412 \u0413\u0410\u041B\u0423\u0417\u0406 \u0413\u0423\u041C\u0410\u041D\u0406\u0422\u0410\u0420\u041D\u0418\u0425 \u0406 \u0421\u0423\u0421\u041F\u0406\u041B\u042C\u041D\u0418\u0425 \u041D\u0410\u0423\u041A"
II.1: "\u0414\u041E\u0421\u041B\u0406\u0414\u0416\u0415\u041D\u041D\u042F \u0422\u0410 \u0420\u041E\u0417\u0420\u041E\u0411\u041A\u0418 \u0412 \u0413\u0410\u041B\u0423\u0417\u0406 \u0413\u0423\u041C\u0410\u041D\u0406\u0422\u0410\u0420\u041D\u0418\u0425 \u041D\u0410\u0423\u041A"
II.1 21.00: "\u0406\u0441\u0442\u043E\u0440\u0438\u0447\u043D\u0456 \u043D\u0430\u0443\u043A\u0438"
II.1 21.00.01: "\u0406\u0441\u0442\u043E\u0440\u0456\u044F \u0423\u043A\u0440\u0430\u0457\u043D\u0438"
