II.1 21.00.07: "\u0406\u0441\u0442\u043E\u0440\u0456\u044F \u043D\u0430\u0443\u043A\u0438"
II.1 21.00.08: "\u041A\u043D\u0438\u0433\u043E\u0437\u043D\u0430\u0432\u0441\u0442\u0432\u043E, \u0431\u0456\u0431\u043B\u0456\u043E\u0442\u0435\u043A\u043E\u0437\u043D\u0430\u0432\u0441\u0442\u0432\u043E, \u0431\u0456\u0431\u043B\u0456\u043E\u0433\u0440\u0430\u0444\u043E\u0437\u043D\u0430\u0432\u0441\u0442\u0432\u043E"
II.1 22.01: "\u041B\u0456\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u043E\u0437\u043D\u0430\u0432\u0441\u0442\u0432\u043E"
II.1 22.01.01: "\u0423\u043A\u0440\u0430\u0457\u043D\u0441\u044C\u043A\u0430 \u043B\u0456\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u0430"
II.1 22.01.02: "\u0420\u043E\u0441\u0456\u0439\u0441\u044C\u043A\u0430 \u043B\u0456\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u0430"
