II.1 22.01.09: "\u041B\u0456\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u043D\u0435 \u0434\u0436\u0435\u0440\u0435\u043B\u043E\u0437\u043D\u0430\u0432\u0441\u0442\u0432\u043E \u0456 \u0442\u0435\u043A\u0441\u0442\u043E\u043B\u043E\u0433\u0456\u044F"
