II.2 29.07.06: "\u0415\u043A\u043E\u043D\u043E\u043C\u0456\u043A\u0430 \u0436\u0438\u0442\u043B\u043E\u0432\u043E\u0433\u043E \u0456 \u043A\u043E\u043C\u0443\u043D\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u0442\u0432\u0430"
II.2 29.08: "\u0415\u043A\u043E\u043D\u043E\u043C\u0456\u043A\u0430 \u043F\u0440\u0438\u0440\u043E\u0434\u043E\u043A\u043E\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u043D\u043D\u044F \u0439 \u043E\u0445\u043E\u0440\u043E\u043D\u0438 \u043D\u0430\u0432\u043A\u043E\u043B\u0438\u0448\u043D\u044C\u043E\u0433\u043E \u0441\u0435\u0440\u0435\u0434\u043E\u0432\u0438\u0449\u0430"
II.2 29.09: "\u0414\u0435\u043C\u043E\u0433\u0440\u0430\u0444\u0456\u044F, \u0435\u043A\u043E\u043D\u043E\u043C\u0456\u043A\u0430 \u043F\u0440\u0430\u0446\u0456 \u0442\u0430 \u0441\u043E\u0446\u0456\u0430\u043B\u044C\u043D\u0430 \u043F\u043E\u043B\u0456\u0442\u0438\u043A\u0430"
II.2 29.10: "\u0420\u043E\u0437\u043C\u0456\u0449\u0435\u043D\u043D\u044F \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0438\u0432\u043D\u0438\u0445 \u0441\u0438\u043B \u0456 \u0440\u0435\u0433\u0456\u043E\u043D\u0430\u043B\u044C\u043D\u0430 \u0435\u043A\u043E\u043D\u043E\u043C\u0456\u043A\u0430"
II.2 30: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u044E\u0440\u0438\u0434\u0438\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
II.2 30.00: "\u042E\u0440\u0438\u0434\u0438\u0447\u043D\u0456 \u043D\u0430\u0443\u043A\u0438"
II.2 30.00.01: "\u0422\u0435\u043E\u0440\u0456\u044F \u0442\u0430 \u0456\u0441\u0442\u043E\u0440\u0456\u044F \u0434\u0435\u0440\u0436\u0430\u0432\u0438 \u0456 \u043F\u0440\u0430\u0432\u0430, \u0456\u0441\u0442\u043E\u0440\u0456\u044F \u043F\u043E\u043B\u0456\u0442\u0438\u0447\u043D\u0438\u0445 \u0456 \u043F\u0440\u0430\u0432\u043E\u0432\u0438\u0445 \u0432\u0447\u0435\u043D\u044C"
II.2 30.00.02: "\u041A\u043E\u043D\u0441\u0442\u0438\u0442\u0443\u0446\u0456\u0439\u043D\u0435 \u043F\u0440\u0430\u0432\u043E"
II.2 30.00.03: "\u0426\u0438\u0432\u0456\u043B\u044C\u043D\u0435 \u043F\u0440\u0430\u0432\u043E \u0456 \u0446\u0438\u0432\u0456\u043B\u044C\u043D\u0438\u0439 \u043F\u0440\u043E\u0446\u0435\u0441, \u0441\u0456\u043C\u0435\u0439\u043D\u0435 \u043F\u0440\u0430\u0432\u043E, \u043C\u0456\u0436\u043D\u0430\u0440\u043E\u0434\u043D\u0435 \u043F\u0440\u0438\u0432\u0430\u0442\u043D\u0435 \u043F\u0440\u0430\u0432\u043E"
II.2 30.00.04: "\u0413\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u0435 \u043F\u0440\u0430\u0432\u043E, \u0430\u0440\u0431\u0456\u0442\u0440\u0430\u0436\u043D\u0438\u0439 \u043F\u0440\u043E\u0446\u0435\u0441"
II.2 30.00.05: "\u0422\u0440\u0443\u0434\u043E\u0432\u0435 \u043F\u0440\u0430\u0432\u043E, \u043F\u0440\u0430\u0432\u043E \u0441\u043E\u0446\u0456\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F"
II.2 30.00.06: "\u0417\u0435\u043C\u0435\u043B\u044C\u043D\u0435 \u043F\u0440\u0430\u0432\u043E, \u0430\u0433\u0440\u0430\u0440\u043D\u0435 \u043F\u0440\u0430\u0432\u043E, \u0435\u043A\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0435 \u043F\u0440\u0430\u0432\u043E, \u043F\u0440\u0438\u0440\u043E\u0434\u043E\u0440\u0435\u0441\u0443\u0440\u0441\u043E\u0432\u0435 \u043F\u0440\u0430\u0432\u043E"
II.2 30.00.07: "\u0410\u0434\u043C\u0456\u043D\u0456\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043D\u0435 \u043F\u0440\u0430\u0432\u043E \u0456 \u043F\u0440\u043E\u0446\u0435\u0441, \u0444\u0456\u043D\u0430\u043D\u0441\u043E\u0432\u0435 \u043F\u0440\u0430\u0432\u043E"
II.2 30.00.08: "\u041A\u0440\u0438\u043C\u0456\u043D\u0430\u043B\u044C\u043D\u0435 \u043F\u0440\u0430\u0432\u043E \u0442\u0430 \u043A\u0440\u0438\u043C\u0456\u043D\u043E\u043B\u043E\u0433\u0456\u044F, \u043A\u0440\u0438\u043C\u0456\u043D\u0430\u043B\u044C\u043D\u043E-\u0432\u0438\u043A\u043E\u043D\u0430\u0432\u0447\u0435 \u043F\u0440\u0430\u0432\u043E"
II.2 30.00.09: "\u041A\u0440\u0438\u043C\u0456\u043D\u0430\u043B\u044C\u043D\u0438\u0439 \u043F\u0440\u043E\u0446\u0435\u0441 \u0442\u0430 \u043A\u0440\u0438\u043C\u0456\u043D\u0430\u043B\u0456\u0441\u0442\u0438\u043A\u0430, \u0441\u0443\u0434\u043E\u0432\u0430 \u0435\u043A\u0441\u043F\u0435\u0440\u0442\u0438\u0437\u0430"
II.2 30.00.10: "\u0421\u0443\u0434\u043E\u0443\u0441\u0442\u0440\u0456\u0439, \u043F\u0440\u043E\u043A\u0443\u0440\u0430\u0442\u0443\u0440\u0430 \u0442\u0430 \u0430\u0434\u0432\u043E\u043A\u0430\u0442\u0443\u0440\u0430"
II.2 30.00.11: "\u041C\u0456\u0436\u043D\u0430\u0440\u043E\u0434\u043D\u0435 \u043F\u0440\u0430\u0432\u043E"
II.2 30.00.12: "\u0424\u0456\u043B\u043E\u0441\u043E\u0444\u0456\u044F \u043F\u0440\u0430\u0432\u0430"
II.2 31: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u043F\u0435\u0434\u0430\u0433\u043E\u0433\u0456\u0447\u043D\u0438\u0445 \u043D\u0430\u0443\u043A"
II.2 31.00: "\u041F\u0435\u0434\u0430\u0433\u043E\u0433\u0456\u0447\u043D\u0456 \u043D\u0430\u0443\u043A\u0438"
II.2 31.00.01: "\u0422\u0435\u043E\u0440\u0456\u044F \u0442\u0430 \u0456\u0441\u0442\u043E\u0440\u0456\u044F \u043F\u0435\u0434\u0430\u0433\u043E\u0433\u0456\u043A\u0438"
