II.2 32.00.05: "\u0421\u043E\u0446\u0456\u0430\u043B\u044C\u043D\u0430 \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0456\u044F, \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0456\u044F \u043E\u0441\u043E\u0431\u0438\u0441\u0442\u043E\u0441\u0442\u0456"
II.2 32.00.06: "\u042E\u0440\u0438\u0434\u0438\u0447\u043D\u0430 \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0456\u044F"
