II.22.40: "\u0414\u043E\u0441\u043B\u0456\u0434\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0432 \u0433\u0430\u043B\u0443\u0437\u0456 \u043D\u0430\u0446\u0456\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u0457 \u0431\u0435\u0437\u043F\u0435\u043A\u0438"
